import React from 'react';

export default class User extends React.Component {
    constructor(props) {
        super(props);
        this.state = {
          items: []
        };
    }
    componentDidMount() {
        fetch('http://localhost:8080/getUser', {
            method: 'GET',
            headers: new Headers({
                'realmId': '4620816365022138560',
                'Accesstoken': 'eyJlbmMiOiJBMTI4Q0JDLUhTMjU2IiwiYWxnIjoiZGlyIn0..wde2EowUOqM3AVQxYhsvKw.WKgiwFX4eSCvejowhMsx-yXtSBzQtZkO2kUyLy0DsXJhdr_BpiilAR8K1bBusHLeIMD5B8GERskg_L4N18xMi_UctgkKwoYEETgnipkpVgHOdeYTqDPRBzFh5OYK0CTnB2zEZle3ALO_nNnt-CDX4NNqrgadqvMmd2pe7pH009TBMIpxwo7-EHitz6P6FP_FvljnluopgSthQy_3V_k3I4H-vygpF-dvJVJgEZy_XPE3rLhDV8U9i08Q7bT5aI7nCGgItlptsmgtTQIr1JYAPaKwWTdfFp7RUszkw_owDO5XtNsqnqXRveQiLJYHDnAsm3CnyAmR7fV6XpVwhc5vwkxCNeiQ3VSEwT3etjoWxLEY_G1hAD7DIrygEb6bTtZ2me9rYEHPaC0itJdpHSz0_NRuinRLDyDLWpewOnUGEoaZImMJYH8dkQ_ADSggKX0YMvzIdgxIp98JIWEgE9BHB11c5Fsq-MYOoE6t9MUZcRZWc8KhUlezRGtbY1WK1cHnoMkPJxqIQ8EU5KhcaTFU18JKZKcPKGnpSZHnzNGpkdd7VWVv1HCoTDYYUqETVH1K8NBsGdw-5g5apJctUmIciEZ4S8YdITTq0_i9CHMdmduH-44OY6EaiaWIQa928ZR0TaIzj81OFTNmy_4iSOIIkTLlJ1q2DIkZ8DUtI9rWqOmGqMFA-Vq7jOZH8MDeFW-PgKqr9GHZ1MKNRZLjXtDSJaUcP_J5lPaCmu17fdtjkjfOI052_gaTn2ZP3CKr_TU9EfJNVjutHvyenbCxgDW1d0Tgq91rCeG3-FYDzj9-kB8wuodRMUVvMmgTm1WpIVL0ZZFaMZiE0Xk9vRpAtrVvfnh3lZam_FN0FV4RdxazC34w4kUD-M60eBqV5QdVNsoioSTGVTT1ErzSXPToYQoDUA.C6IYyJBd77LgdqKIdoAClg'
            })
        })
            .then(res => res.json())
            .then(items=>this.setState({items}))
    }

    render() {
        const {items} = this.state;
        return (
            <div style={{textAlign: 'center', marginTop: '200px', marginLeft: '50px'}}>
                {items.response}
            </div>
        );
    }
}
